      </h1>
      <h1 className="ProductsLayout-price">
        Price<p className="ProductsLayout-price-itemPrice">100$</p>
      </h1>
      <p className="ProductsLayout-details">Details Here !!</p>
      <h1 className="ProductsLayout-quantity">Quantity</h1>
      <button className="ProductsLayout-button">Get</button>
    </section>
  );
}
